/**
 * @requires ../../js/jquery-1.7.2.js
 * @requires ../../js/closure_compiler_utils.js
 */

goog.provide('ccu.test1');

(function () {
  /**
   * @constructor
   */
  ccu.test1.TestClass = function (item) {
    this._item = item
  }

  var TestClass = ccu.test1.TestClass;

  ccu.proc(
    TestClass,
    /**
     * @lends ccu.test1.TestClass
     */
    {
      getItem : function () {
        return this._item;
      },

      setItem : function (item) {
        this._item = item
      }
    });
})();
